import React, { useState, useEffect } from 'react';
import './RealtorPage.css'; // Импорт стилей для страницы риэлтора

const RealtorPage = () => {
  // Добавляем состояние для отзывов, текущего индекса и текста нового отзыва
  const [reviews, setReviews] = useState([]);
  const [currentIndex, setCurrentIndex] = useState(0);
  const [newReviewText, setNewReviewText] = useState('');

  // Имитация загрузки отзывов
  useEffect(() => {
    const timer = setTimeout(() => {
      setReviews([
        { id: 1, text: "Отличный риэлтор!", author: "Иван Иванов", avatar: "avatar1.jpg" },
        { id: 2, text: "Профессиональный подход!", author: "Петр Петров", avatar: "avatar2.jpg" },
        { id: 3, text: "Сделка прошла гладко.", author: "Анна Сидорова", avatar: "avatar3.jpg" }
      ]);
    }, 2000);

    return () => clearTimeout(timer);
  }, []);

  // Функция для переключения комментариев
  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentIndex((prevIndex) => (prevIndex === reviews.length - 1 ? 0 : prevIndex + 1));
    }, 5000);

    return () => clearInterval(interval);
  }, [reviews]);

  // Функция для добавления нового отзыва
  const handleAddReview = () => {
    if (newReviewText.trim() !== '') {
      const newReview = {
        id: Date.now(), // Просто используем текущее время в миллисекундах в качестве ID
        text: newReviewText,
        author: "Зарегистрированный пользователь", // Здесь можно указать имя пользователя или его ID
        avatar: "default-avatar.jpg" // Здесь можно использовать аватар пользователя или его изображение по умолчанию
      };

      setReviews([...reviews, newReview]);
      setNewReviewText(''); // Очищаем поле ввода после добавления отзыва
    }
  };

  return (
    <div className="realtor-container">
      <div className="realtor-info">
        <div className="realtor-avatar">
          <img src="realtor-avatar.jpg" alt="Realtor Avatar" />
        </div>
        <div className="realtor-details">
          <h1>Гуренко Евгений Александрович</h1>
          <p>Контактный телефон: +7 (951) 005-00-02</p>
          <p>Email: gurenko.ru@gmail.com</p>
          <p>Описание: Профессиональный риэлтор с многолетним опытом в сфере недвижимости. </p>
            <p>Помогу вам найти идеальное жилье!</p>
        </div>
      </div>
      <div className="reviews">
        <h2>Отзывы:</h2>
        <ul>
          {reviews.map((review, index) => (
            <li key={review.id} style={{ display: index === currentIndex ? 'block' : 'none', animationDelay: `${index * 0.2}s` }}>
              <div className="review-author">
                <img src={review.avatar} alt="Author Avatar" className="review-avatar" />
                <span>{review.author}</span>
              </div>
              <p>{review.text}</p>
            </li>
          ))}
        </ul>
      </div>
      
      <div className="add-review">
        <textarea
          value={newReviewText}
          onChange={(e) => setNewReviewText(e.target.value)}
          placeholder="Напишите ваш отзыв..."
        />
        <button onClick={handleAddReview}>Отправить отзыв</button>
      </div>
      <div className="social-links">
        <a href="https://www.instagram.com/" target="_blank" rel="noopener noreferrer"><img src="instagram.svg" alt="Instagram" /></a>
        <a href="https://www.vk.com/" target="_blank" rel="noopener noreferrer"><img src="vk.png" alt="Twitter" /></a>
      </div>
    </div>
  );
};

export default RealtorPage;
